@Me
1)  I nearly got to visit your country Switzerland back in 2011.  I had planned to visit Switzerland after spending 3 months visiting Germany and the three Scandinavian countries.  After spending 3 months visiting these countries, I then learnt that Switzerland had just joined the Schengen zone in 2011.  That means I had to cancel my planned visit to Switzerland because I had already spent 3 months staying in the Schengen Zone and it is illegal for a visitor from outside the Schengen Zone to stay more than 3 months in the Zone.  But one day I will come to Switzerland.

2)  As beautiful as Switzerland is, I have to say, as a non-Swiss citizen, that the most beautiful thing about Switzerland is its direct democracy.
